pols = list("ABCDEFGHIJKLMNOPQRSTUVWXYZ")


def badPoly(nn):
    shortest = 10**10
    pol = ""
    for p in pols:
        q = list("".join(nn).replace(p, "").replace(p.lower(), ""))
        x = numFind(q)
        if x < shortest:
            shortest = x
            pol = "{}/{}".format(p, p.lower())
            print("{}: {}".format(pol, shortest))
    return "{}: {}".format(pol, shortest)


def numFind(n):
    react = False
    for i in range(len(n) - 1):
        if n[i] == key[n[i + 1]]:
            react = True
            n[i] = "#"
            n[i + 1] = "#"
    if react:
        n = list("".join(n).replace("#", ""))
        return numFind(n)
    return len(n)


